import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Auth from './components/Auth';
import CaseOpening from './components/CaseOpening';
import Inventory from './components/Inventory';
import Profile from './components/Profile';
import AdminPanel from './components/AdminPanel';
import './styles/App.css';

function App() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // Проверка токена и получение данных пользователя
      fetch('http://localhost:5000/api/auth/profile', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      })
      .then(res => res.json())
      .then(data => {
        if (data.id) {
          setUser(data);
        } else {
          localStorage.removeItem('token');
        }
        setLoading(false);
      })
      .catch(() => {
        localStorage.removeItem('token');
        setLoading(false);
      });
    } else {
      setLoading(false);
    }
  }, []);

  const logout = () => {
    localStorage.removeItem('token');
    setUser(null);
  };

  if (loading) {
    return (
      <div className="loading-screen">
        <div className="blood-text">MushCase</div>
        <div className="loading-spinner"></div>
      </div>
    );
  }

  return (
    <Router>
      <div className="App">
        <div className="particles"></div>

        {user ? (
          <>
            <header className="header">
              <div className="container">
                <h1 className="logo blood-text">MushCase</h1>
                <nav className="nav">
                  <a href="/">Кейсы</a>
                  <a href="/inventory">Инвентарь</a>
                  <a href="/profile">Профиль</a>
                  {user.role === 'admin' && <a href="/admin">Админ</a>}
                </nav>
                <div className="user-info">
                  <span className="balance">{user.balance}₽</span>
                  <button onClick={logout} className="logout-btn">Выход</button>
                </div>
              </div>
            </header>

            <main className="main">
              <Routes>
                <Route path="/" element={<CaseOpening user={user} setUser={setUser} />} />
                <Route path="/inventory" element={<Inventory user={user} setUser={setUser} />} />
                <Route path="/profile" element={<Profile user={user} setUser={setUser} />} />
                {user.role === 'admin' && (
                  <Route path="/admin" element={<AdminPanel />} />
                )}
                <Route path="*" element={<Navigate to="/" />} />
              </Routes>
            </main>
          </>
        ) : (
          <Auth setUser={setUser} />
        )}
      </div>
    </Router>
  );
}

export default App;
